import React, { Component } from "react";

class Forum extends Component {
  render() {
    return (
      <div className="view">
        <h1>Forum</h1>
        <div className="content">
          <div className="content--inner">
            <p className="content--excerpt">This project was made by Ivan and Emil</p>
            <p>Here will be the forum</p>
          </div>
        </div>
      </div>
    );
  }
}

export default Forum;
